    false,nt"url": null,nt"notes": "This memorandum contains eight research
    proposals the Red Rock Lakes National Wildlife Refuge submitted to the Region's
    research needs and proposal review process. This process was developed to evaluate
    research proposals of local or regional importance for potential funding from various
    sources which include nongarne and neotropical migrant funding, challenge grants,
    reverted Pittman-Robertson funds, and onetime funding opportunities. Proposals are
    ranked by the stations priority and contain objectives, justification, procedures,
    cooperators, cost, and schedule for each of the eight proposals. Proposals submitted
    are: "Sage grouse declines in SW Montana and SE Idaho: A short term concern or
    serious resource crisis?", "Avian Guild Composition in Relation to Influences
    of Wild and Domestic Ungulates on Aspen Community Structure", "Red Rock Lakes
    National Wildlife Refuge Fisheries Habitat Enhancement and Management", "Effects
    of Grazing and Fire on Plant Communities and Mammalian Diversity within Refuge Habitats",
    "Red Rock Lakes National Wildlife Refuge Sensitive Plant Survey", "Habitat and
    Breeding Bird Distribution Inventories", "Geographic Information System Setup",
    "Restoring the West's Critical Stream Corridors: Evaluating Stream Conditions and
    Trends on Public Lands Grazed by Livestock".",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
